import React from 'react';
import { Container } from 'react-bootstrap';
import map from '../../assets/images/map.jpg'
import classes from './Ride.css'

export const Ride=({
  id,
  origin_station,
  station_path,
  date,
  distance,
  onClick,
  city,
  state,
})=>{

    return (
        <Container>
            <Row>
                <Col>
                <img src={map} alt="map" />
                </Col>
                <Col>
                     <div>
        <p>
          <span className={classes.line}>Ride Id </span>: {id}
        </p>
        <p>
          <span className={classes.line}>Origin Station </span>: {origin_station}
        </p>
        <p>
          <span className={classes.line}>Station Path </span>: {JSON.stringify(station_path)}
        </p>
        <p>
          <span className={classes.line}>Date </span>: {date}
        </p>
        <p>
          <span className={classes.line}>Distance </span>: {distance}
        </p>
      </div>
                </Col>
            </Row>
            </Container>
        // <div className={classes.ride}>


    //</div>
    );
}; 

export default Ride;
